import React, {useEffect} from 'react';
import { HeaderPage, TableGrade } from "../../components/Admin";
import { useGrade } from '../../hooks';
import { Loader } from 'semantic-ui-react';
import {  } from "../../components/"

export function GradesAdmin() {
  const { loading, grades, getGrades } = useGrade();

  useEffect(() => getGrades(), []);
  
  return (
    <>
      <HeaderPage title="Cursos" btnTitle="Nuevo curso" />
      {loading ? (
        <Loader active inline="centered">
          Cargando ...
        </Loader>
      ) : (
        <TableGrade grades={grades} />
      )}
    </>
  );
}
